import React from "react";
import styles from "./Line.module.scss";
const Line = ({ isTouched, onToggle, title, content }) => {
  return (
    <>
      <div onClick={onToggle} className={styles.line}>
        <div className={`${styles.button} ${isTouched && styles.animateButton}`}>
          <div></div>
          <div></div>
        </div>
        <div className={styles.right}>
          <div>{title}</div>
        </div>
      </div>
      <div aria-expanded='true' className={`${styles.content} ${isTouched && styles["content-block"]}`}>
        Với triết lý: MINH BẠCH, NHIỆT HUYẾT, TẬN TÂM, AN TOÀN. G-Store sẽ là sự
        tập hợp, kết nối các nguồn lực toàn cầu nhằm mục đích xây dựng các sản
        phẩm, dịch vụ với nền tảng công nghệ 4.0 tạo ra lợi ích cho cộng đồng và
        xã hội
      </div>
    </>
  );
};

export default Line;
